import React, {memo} from 'react';
import styled from 'styled-components';

const IndexContainer = styled.div`
    background-color: #ff0;
`;

const index = memo(() => {
  return (
    <IndexContainer>
      <h1>hello</h1>
    </IndexContainer>
  );
});

export default index;
